    public static List<KLineEntity> getData(String key) {
        String data = tabData1min;
        if ("1min".equals(key)) {
            data = tabData1min;
        } else if ("5min".equals(key)) {
            data = tabData5min;
        }

        List<KLineEntity> kLineEntityList = new ArrayList<>();
        try {
            JSONObject json = new JSONObject(data);
            JSONArray jsonArray = json.getJSONArray("redata");
            for (int i = 0; i < jsonArray.length(); i++) {
                JSONObject jsonObject = jsonArray.getJSONObject(i);
                KLineEntity kLineEntity = new KLineEntity();
                kLineEntity.Date = jsonObject.getString("日期");
                Date date = TimeUtils.string2Date(kLineEntity.Date, DateUtil.strFormat);
                kLineEntity.Date = new DateFormatter().format(date);
                kLineEntity.Open = (float) jsonObject.getDouble("开盘价");
                kLineEntity.High = (float) jsonObject.getDouble("最高");
                kLineEntity.Low = (float) jsonObject.getDouble("最低");
                kLineEntity.Close = (float) jsonObject.getDouble("收盘价");
                kLineEntity.Volume = (float) jsonObject.getDouble("成交量");
                kLineEntityList.add(kLineEntity);
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
        return kLineEntityList;

    }

